		inline const std::string get_serialized_model(std::string file_name)
		{
			std::string base64;

#if 0
			std::ifstream input(file_name.c_str(), std::ios::binary);
			std::vector<char> buffer((
				std::istreambuf_iterator<char>(input)),
				(std::istreambuf_iterator<char>()));
			
			size_t size = buffer.size();

			base64.resize(Base64::EncodedLength(size));
			Base64::Encode(&buffer[0], size, &base64[0], base64.size());

			std::ofstream output((file_name + "base64.txt ").c_str());
			for (int i = 0; i < ceil(base64.size() / 10000.) + 1; ++i) {
				int offset = i * 10000;
				if (offset > base64.size())
					break;
				output.write("\"", 1);
				output.write(&base64[0] + offset, min(base64.size() - offset, 10000));
				output.write("\",\n", 3);
			}
			output.close();
#endif

			if (file_name.find("cnn4face1_new") != std::string::npos)
				base64 = cnn4face1_new_base64_chars;
			if (file_name.find("cnn4face2_new") != std::string::npos)
				base64 = cnn4face2_new_base64_chars;
			if (file_name.find("cnn4face3_new") != std::string::npos)
				base64 = "";
				for (int i = 0; i < cnn4face3_new_base64_chars.size(); ++i) {
					base64 += cnn4face3_new_base64_chars[i];
				}

			if (file_name.find("cnn4face1_cntk") != std::string::npos)
				base64 = cnn4face1_cntk_base64_chars;
			if (file_name.find("cnn4face2_cntk") != std::string::npos)
				base64 = cnn4face2_cntk_base64_chars;
			if (file_name.find("cnn4face3_cntk") != std::string::npos)
				base64 = cnn4face3_cntk_base64_chars;
			if (file_name.find("cnn4landmarks_cntk") != std::string::npos)
				base64 = "";
				for (int i = 0; i < cnn4landmarks_cntk_base64_chars.size(); ++i) {
					base64 += cnn4landmarks_cntk_base64_chars[i];
				}

			if (base64.size() == 0)
				return std::string();

			std::string decoded;
			decoded.resize(Base64::DecodedLength(base64));
			Base64::Decode(&base64[0], base64.size(), &decoded[0], decoded.size());

			return decoded;
		}

